import Button from "./Button";
import strings from "../strings.json";

function NewsletterForm(props) {
    function handle(event) {
        event.preventDefault();
    }

    return <form onSubmit={handle} className="newsletter">
        <style jsx>{`p.small{font-size:15px;margin:0;text-align:left;color:#111;}`}</style>
        <input placeholder={strings.english.common.EmailAddressPlaceholder} />
        <Button>{strings.english.common.SignUp}</Button>
        <p className="small mt-1">Hello world.</p>
        {props.children}
    </form>
}

export default NewsletterForm;
